window.bookSummaryJSON = "<p>Post-war Denver is ruled by the powerful Guild, an egalitarian regime intent on maintaining order at all costs. But some of the citizens remember what it was like before the fall of the old world and will stop at nothing to bring back capitalism and democracy to their city. </p> <p>Meanwhile, Misha, a young farm boy with his head in the clouds, is lured in by the beautiful Kara. She holds the key to a secret that will bring Misha's world crashing down and has the potential to change his future. </p>"; 
